import axios from "axios";

export const authService = {

    createFundingSourceService: (body) => axios.post('/funding', body),

    getFundingSourceService: () => axios.get('/funding',),

    getFoundingSourceById: (id) => axios.get(`/funding/${id}`,),

    getFoundingSourceServiceById: (id) => axios.get(`/funding/${id}/service`,),

    createFoundingSourceServiceById: (id,body) => {
       alert(id)
        axios.get(`/funding/${id}/service`)
    },

    getFundingSourceHistoriesById: (id) => axios.get(`/funding/${id}/histories`,),

};
